import './Dashboard.css'

import {Link} from 'react-router-dom'

class Dashboard extends Component {

  render() {
    return (
      <div>
        Dashboard
        <Link className="display project-display" to="/projects">
          <h3>{projects.length}</h3>
          <p>Projects</p>
        </Link>
      </div>
    )
  }

}

export default Dashboard
